interface UserInput {
  username: string,
  email: string,
  password: string 
} 

export default class User {
  username: string;
  email: string;
  password: string;

  constructor(
    { username = "",
      email    = "",
      password = "" }: UserInput = {}
  ) {
    this.username = username;
    this.email = email;
    this.password = password;
  }

  get isEmpty(): boolean {
    return (this.username === ""
            && this.email === ""
            && this.password === "");
  }

  json(): string {
    return JSON.stringify(this);
  }
}
